import styled from "styled-components";

export const StyleCardCreate = styled.div`
  width: 300px;
  height: 400px;
  background-color: white;
  position: absolute;
  border-radius: 20px;
  display: flex;
  justify-content: center;
  form {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-around;
    padding: 20px;
    h2 {
      color: var(--black);
    }
    svg {
      position: absolute;
      top: 0;
      right: 0;
      margin: 20px;
    }
  }
`;
